import SearchBar from "./SearchBar";
import Grid from "@material-ui/core/Grid";
import Paper from "@material-ui/core/Paper";
import Container from "@material-ui/core/Container";
import LocationCard from "./LocationCard";

const SearchResult = ({ result, query, isLoading, handleSubmit }) => {
	const queryResult = result.map((element, index) => (
		<section key={index}>
			<p>{element.address} </p>
			<p>Available lots: {element.availableLots}</p>
			<p>Total lots: {element.totalLots}</p>
			<p>Free parking: {element.freeParking}</p>
			<p>Non season parking: {element.nonSeasonLot}</p>
		</section>
	));
	return (
		<div>
			<SearchBar handleSubmit={handleSubmit} />
			{isLoading ? (
				<div>Loading......</div>
			) : (
				<h2>Showing results for "{query}"</h2>
			)}
			{result.map((element, index) => (
				<LocationCard element={element} index={index} />
			))}
			;
		</div>
	);
};

export default SearchResult;
